import React from 'react'
import FutureEvent from './FutureEvent'

function Calender() {
    //imports json with all future events and makes event objects from each entry

    return (
        <div>
            <subheading class = 'font-bold text-xl'>
                Future Events
            </subheading>
            <events class = ''>
                <FutureEvent/>
            </events>
        </div>
    )
}

export default Calender
